import React from 'react';
import Navbar from 'react-bootstrap/Navbar'

const NavBar = () => {
    return (
        <Navbar bg="dark" expand="lg">
            <Navbar.Brand href="/">Watcher</Navbar.Brand>
        </Navbar>
    )
};

export default NavBar;
